DROP TABLE IF EXISTS `project`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `project` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `title` varchar(32) DEFAULT NULL,
  `name` varchar(32) NOT NULL COMMENT 'app name',
  `descr` varchar(256) DEFAULT NULL,
  `git` varchar(128) NOT NULL,
  `pre_host` varchar(64) DEFAULT NULL,
  `online_host` varchar(1024) NOT NULL COMMENT '机器列表：端口',
  `owner_id` bigint(20) DEFAULT NULL COMMENT '开发负责人',
  `test_id` bigint(20) DEFAULT NULL COMMENT '测试负责人',
  `type` int(11) NOT NULL COMMENT '0:java   1:静态资源',
  `source_path` varchar(128) DEFAULT '' COMMENT '源代码路径',
  `target_path` varchar(128) DEFAULT '' COMMENT '目标机器文件位置',
  `gmt_create` datetime DEFAULT NULL,
  `gmt_modified` datetime DEFAULT NULL,
  `file_name` varchar(255) DEFAULT NULL COMMENT '要同步的文件，可以是目录',
  `build_log` varchar(128) DEFAULT NULL,
  `app_log` varchar(128) DEFAULT NULL,
  `before_sync` varchar(256) DEFAULT NULL COMMENT '同步文件前需要执行的脚本',
  `after_sync` varchar(256) DEFAULT NULL COMMENT '同步文件后需要执行的脚本',
  `remote_user` varchar(64) DEFAULT NULL COMMENT '目标机器用户',
  `need_approval` int(11) DEFAULT '0',
  `pre_build` varchar(256) DEFAULT NULL,
  `online_build` varchar(256) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

